import React from 'react';
import Fcard from './Fcard';

const Followers = () => {
    return(
        <div className='followerGrid'>
        <div></div>
        <Fcard topBorder={'hsl(208, 92%, 53%)'}/>
        <Fcard topBorder={'hsl(203, 89%, 53%)'}/>
        <Fcard topBorder={'linear-gradient(-90deg,hsl(37, 97%, 70%), hsl(329, 70%, 58%))'}/>
        <Fcard topBorder={'hsl(348, 97%, 39%)'}/>
        </div>
    )
}

export default Followers;
